import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import NavBar from './NavBar';
import Home from './';

function Notes() {
	return (
		<Router>
			<div className="notes-page">
				<NavBar />
				<Home />
			</div>
		</Router>
	);
}

export default Notes;
